import React, {Component} from 'react';


class ProductItem extends Component {
    render(){
        const {name, onDelete, price} = this.props;

        return(
            <div>
            <span>{name}</span> 
            {' | '}
            <span>{price}</span>
            {' | '}
            <button onClick={this.onDelete}>Delete</button>
          </div>
        );
    }
}


export default ProductItem;
